MongoDB query elements that are in an array<p>I am working in a mongoDB + node (with express and mongoose) API.</p>

<p>I have a document with more or less this structure:</p>

<pre><code>// npcs
{
   "_id" : ObjectId("5ea6c0f88e8ecfd3cdc39eae"),
    "flavor" : {
        "gender" : "...",
        "description" : "...",
        "imageUrl" : "...",
        "class" : "...",
        "campaign" : [ 
            {
                "campaignId" : "5eac9dfe8e8ecfd3cdc41aa0",
                "unlocked" : true
            }
        ]
    },
},
// ...
</code></pre>

<p>And a second document in a separate table that is as follows:</p>

<pre><code>// user
{
"_id" : ObjectId("5e987f8e4b88382a98c84042"),
    "username" : "KuluGary",
    "campaigns" : [ 
        "5eac9dfe8e8ecfd3cdc41aa0", 
        "5eac9e458e8ecfd3cdc41ac1", 
        "5eac9e978e8ecfd3cdc41adb", 
        "5eac9eae8e8ecfd3cdc41ae3"
    ]    
}
</code></pre>

<p>What I want to do is make a query in which I obtain all the NPCs that are a part of a campaign the user is part of, and are unlocked.  The second part is fairly easy, just thought of once I retrieve the NPCs to filter those with unclocked false, but I'm having a hard time visualizing the query since I'm fairly unfamiliar with mongoDBs syntax and usage.</p>

<p>Any help would be greatly appreciated.</p>

