I am trying to create function, where a randomly generated String is queried to check if it exists or not. If it already exists, the String is randomly generated till it is unique. </p>

<pre><code>      let validID = false;
      console.log(temp); //temp is the randomly generated String.
      while(!validID){
        Website.findOne({shortcut: temp},function(err,docs){
            if(docs==null){
              validID = true;
              console.log("The shortcut for the url is" + temp);              
            }else{
              console.log("FOUND");
              temp = generateId();
            }
