Match "x out of y" fields in a document<p>I'm writing a service to handle bans for a game and I'm currently a bit stuck trying to write a MongoDB query. Currently I have a collection of "User" objects, and the objects look like this:</p>

<pre class="lang-cs prettyprint-override"><code>public class User
{
    public List&lt;Ban&gt; Bans { get; set; }

    // some irrelevant additional fields
}

public class Ban
{
    public HardwareId HWID { get; set; }

    public DateTime Expires { get; set; }

    // some irrelevant additional fields
}

public class HardwareId : IEquatable&lt;HardwareId&gt;
{
    public string Field1 { get; set; }

    public string Field2 { get; set; }

    public string Field3 { get; set; }

    public string Field4 { get; set; }

    public bool Equals([AllowNull] HardwareId other)
    {
        if (ReferenceEquals(other, null)) return false;
        if (ReferenceEquals(this, other)) return true;

        return Field1 == other.Field1 &amp;&amp;
            Field2 == other.Field2 &amp;&amp;
            Field3 == other.Field3 &amp;&amp;
            Field4 == other.Field4;
    }
}
</code></pre>

<p>What I want to do is have a query that finds all users with a ban where HWID has say 3 out of 4 fields matching. Currently I have a query that only finds users where the HWID match exactly (due to the Equals() implementation), but I'd like to change it. My current code looks like this:</p>

<pre class="lang-cs prettyprint-override"><code>public Ban FindBan(HardwareId hwid)
{
    var banBuilder = Builders&lt;Ban&gt;.Filter;
    var hwidFilter = banBuilder.Eq(b =&gt; b.HWID, hwid);
    var expFilter = banBuilder.Gt(b =&gt; b.Expires, DateTime.UtcNow);
    var banFilter = banBuilder.And(hwidFilter, expFilter);

    var user = _users.Find(Builders&lt;User&gt;.Filter.ElemMatch(p =&gt; p.Bans, banFilter)).FirstOrDefault();
    if (user != null)
    {
        return user.Bans[0];
    }

    return null;
}
</code></pre>

<p>The only way of solving it I can think of is to write "spaghetti if-statements" in the Equals() function, but I'd like a dynamic solution where I could add multiple "Fields" to the HardwareId class later down the line. Another issue with the FindBan() function currently is the fact that it returns "user.Bans[0]" instead of the actual ban that was found, but I imagine I could solve that by sorting by expiry.</p>

